import React, { Component } from 'react';
import './Todo.scss';

class Todo extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    console.log(this.props.msg);
    return <div className="todo">Todo</div>;
  }
}

export default Todo;
